INSERT INTO `events` VALUES (1,'Harmony Fest','Festival','Venue: Central Park Address: 123 Main Street, Anytown, USA','2024-05-15 18:00:00',100,800,'550000','215000','Get ready for Harmony Fest, the ultimate celebration of music, food, and community! Join us for a day filled with live performances from top artists, delicious culinary delights, and a vibrant atmosphere buzzing with energy. From rocking out to your favorite bands to savoring mouthwatering treats from local vendors, Harmony Fest promises an unforgettable experience for all ages. Don\'t miss out on this day of harmony and fun for the whole family!',1),(2,'Opera Fusion','Opera','Venue: Metropolitan Opera House Address: 30 Lincoln Center Plaza, New York, NY, USA','2024-05-05 19:30:00',50,150,'35000','20000','Experience the magic of Opera Fusionan enchanting blend of classical beauty and contemporary allure. Held at Symphony Hall, this unforgettable event features world-renowned performers, captivating narratives, and opulent ambiance. From beloved classics to innovative interpretations, Opera Fusion promises an evening of cultural enrichment and soul-stirring artistry. Don\'t miss this opportunity to immerse yourself in the transcendent world of opera.',2),(3,'Sting of Rock','Concert','Venue: Red Rocks Amphitheatre Address: 18300 W Alameda Pkwy, Morrison, CO, USA','2024-06-05 20:00:00',150,500,'295000','174000','Rock out with the Scorpions at \"Sting of Rock\"! Join us for a night of electrifying performances and timeless hits at this iconic concert event. From anthemic riffs to soulful ballads, experience the legendary sound of one of rock music\'s most iconic bands. Don\'t miss the Scorpions live in action at \"Sting of Rock\"!',3),(4,'Verona Chronicles','Theatre','Venue: The Studio Theatre Address: 1501 14th St NW, Washington, DC, USA','2024-05-20 19:00:00',70,300,'98500','52000','Experience the captivating drama of \"Veronica Chronicles\" at the theater near you! Immerse yourself in the compelling narrative and powerful performances of this theatrical masterpiece. From gripping plot twists to unforgettable characters, \"Veronica Chronicles\" promises an evening of entertainment that will leave you spellbound. Don\'t miss your chance to witness the magic of live theater with \"Veronica Chronicles\"!',4),(5,'Cultural Odyssey','Exhibition','Venue: Smithsonian Institution - National Museum of Natural History Address: 10th St & Constitution Ave NW, Washington, DC, USA','2024-06-15 17:00:00',20,80,'8000','5500','Discover a Cultural Odyssey at our exhibition! Explore diverse cultures and traditions from around the globe. From ancient artifacts to contemporary art, immerse yourself in the richness of human expression. Join us for an inspiring journey through the universal human experience.',5);
/*!40000 ALTER TABLE `events` ENABLE KEYS */;
